import React from 'react';
import {Route, BrowserRouter as Router, Link, Redirect, Switch} from "react-router-dom";
import Users from "./Components/Users/pages/Users";
import Places from "./Components/Places/pages/Places";


const App = () => {
  return (
  <Router>
    <Route path={'/users'} component={Users} exact={true}/>
    <Route path={'/places'} component={Places} exact={true}/>
    <Redirect to={'/'}/>

  </Router>
  )
}

export default App;
